import React from "react";
import IInfos from "../../../types";


export default function Item(
    {Model, Licenseplate, Entrada,  index} : 
    {Model: string, Licenseplate: string, Entrada: string, index: number}){
    return(
        <tr key={index}>
        
        <td>{Model}</td>
        <td>{ Licenseplate }</td >
        <td>{Entrada}</td>
        </tr>
    )


}
